// App.js
import React from 'react';
import Header from './components/Header';
import './components/styles.css';
import homeImage from './images/home.jpg';
import styles from './App.css'; // Assuming you're using a CSS module approach

const App = () => {
  return (
    <div className="app">
      <Header />
      <main className={styles.mainContent}>
        <div className={styles.imageContainer}>
          <div className={styles.centeredImageWrapper}>
            <img className={styles.homeImage} src={homeImage} alt="Home" />
          </div>
        </div>
        <div className={styles.colorBlock}>
          <h2>My Recent Projects</h2>
          <p>This is a description of my recent projects.</p>
        </div>
      </main>
    </div>
  );
};

export default App;
